window.bookSummaryJSON = "<p>The first short-story collection in the number-one <i>New York Times</i>- best-selling series - including brand-new Harry Dresden short stories! </p> <p>Here, together for the first time, are the shorter works of best-selling author Jim Butcher - a compendium of cases that Harry and his cadre of allies managed to close in record time. The tales range from the deadly serious to the absurdly hilarious. Also included is a new, never-before-published novella that takes place after the cliff-hanger ending of <i>Changes</i>. This is a must-have collection for every devoted Harry Dresden fan, as well as a perfect introduction for readers ready to meet Chicago's only professional wizard.</p>"; 
